'use strict';var app=new Vue({el:"#calc-percentages",data:{sidea:0,sideb:0,selected:""},methods:{no_values(a){switch(a){case "Rechteck":return"Hinweis: Bitte Side A und Side B ausf\u00fcllen!";case "Quadrat":return"Hinweis: Bitte nur Side A ausf\u00fcllen!"}},selected_calc(a){switch(a){case "Rechteck":return 2*this.sidea+2*this.sideb;case "Quadrat":return 4*this.sidea}}}});